import React from 'react'


const scrollButton = () => {
    const scroll = (e) => {
        e.preventDefault();
        const pageHeight = window.innerHeight;
        window.scrollBy(0, pageHeight);
    }
    return(
        <button onClick = {scroll}>
            Next
        </button>
    )
}

export default scrollButton;
